import React from 'react';
import { Menu, Button, MenuItem } from '@material-ui/core';

export default function SimpleMenu() {
    const [anchorEl, setAnchorEl] = React.useState(null);
    const [selectedNumber, setSelectedNumber] = React.useState(0);

    const selectNumber = numberSelected => {
        setSelectedNumber(numberSelected)
    }

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };

    return (
        <div>
            <Button value="Time" aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}/>
            <Menu
                id="simple-menu"
                anchorEl={anchorEl}
                keepMounted
                open={Boolean(anchorEl)}
                onClose={handleClose}
                PaperProps={{ style: {maxHeight: 200}} }
            >
                <MenuItem onClick={handleClose}>12:00am</MenuItem>
            </Menu>
            <Button onClick={selectedNumber}>5</Button>
            <Button onClick={selectedNumber}>7</Button>
            <div>selectedNumber</div>
        </div>
    );
}
